/* // custom events IE fix */
(function ($) {
    
    var supportsTransition = function () {
        var div = document.createElement("div");
        var p, ext, pre = ["ms", "O", "Webkit", "Moz"];
        for (p in pre) {
            if (div.style[pre[p] + "Transition"] !== undefined) {
                ext = pre[p];
                break;
            }
        }
        return ext;
    };
    
    var do3dTranslate = function (ele, x, y) {
        $(ele).css('-' + supportsTransition() + '-transform', 'translate3d(' + x + ', ' + y + ', 0)');
    };
    
    var doNormalTranslate = function (ele, x, y) {
        $(ele).css({
            "left": x,
            "top": y
        });
    };
    
    var isSupport3d = function () {
        var el = document.createElement('div'),
            supportsTranslate3D, transforms = {
                'WebkitTransform': '-webkit-transform',
                'OTransform': '-o-transform',
                'MSTransform': '-ms-transform',
                'MozTransform': '-moz-transform',
                'Transform': 'transform'
            };

        // Add it to the body to get the computed style.
        document.body.insertBefore(el, null);

        var t;
        for (t in transforms) {
            if (el.style[t] !== undefined) {
                el.style[t] = "translate3d(1px,1px,1px)";
                supportsTranslate3D = window.getComputedStyle(el).getPropertyValue(transforms[t]);
            }
        }

        document.body.removeChild(el);

        return (supportsTranslate3D !== undefined && supportsTranslate3D !== null && supportsTranslate3D.length > 0 && supportsTranslate3D !== "none");
    };
    
    if (isSupport3d) {
        var doTranslate = do3dTranslate;
    } else {
        var doTranslate = doNormalTranslate;
    }
    
    /** heading parallax **/
    $.fn.headingParallax = function () {
        
        var element = $(this);
        var toplimit = 0;
        var bottomlimit = 0;
        var topoffset = 0;
        var eleheight = 0;
        var scrollpos = 0;
        var hh = 0;

        var eleslideholder = $(element).find('.bg-holder:not(.overlay)');
        var eleslideoverlay = $(element).find('.bg-holder.overlay');
        var eledisappear = $(element).find('.bg-holder.to-disappear');
        var eletextholder = $(element).find('.ls-texts');

        var resize_container = function () {
            topoffset = $(element).offset().top;
            eleheight = $(element).height();

            toplimit = topoffset + hh;
            bottomlimit = topoffset + eleheight - hh;
        };

        function scrolleffect() {
            
            if (scrollpos > toplimit && scrollpos < bottomlimit) {
                // on screen
                var ratio = 0;
                ratio = (scrollpos - topoffset - hh) / eleheight;

                // opacity
                $(eletextholder).css({ 'opacity': (1 - (ratio*1.6)) });
                eledisappear.css({ 'opacity': (1 - (ratio*1.6)) });

                // centering
                var centering = (ratio * eleheight / 2);
                
                doTranslate(eleslideholder, "0px", centering + "px");
                doTranslate(eleslideoverlay, "0px", ( centering * 0.6 ) + "px");
                doTranslate(eletextholder, "0px", ( centering * 0.9 ) + "px");
                
            }
        }

        function scrollcallback() {
            scrollpos = $(window).scrollTop();
            scrolleffect();
        }

        $(window).bind('resize load', resize_container);

        if ( ! bwpb_params.ismobile) {
            $(window).on('scroll', scrollcallback);
        }
    };
    
    $.new_get_image_container_size = function (img, container, mode) {
        var nh, nw, nt, nl;

        var h = $(img).get(0).naturalHeight;
        var w = $(img).get(0).naturalWidth;

        if (h === 0) {
            h = $(img).data('height');
            w = $(img).data('width');
        }

        var r = ( h / w );
        var wh = $(container).height();
        var ww = $(container).width();
        var wr = wh / ww;

        var resizeWidth = function () {
            nw = ww;
            nh = ww * r;
            nl = ( ww - nw ) / 2;
            nt = ( wh - nh ) / 2;

            return [nh, nw, nl, nt];
        };

        var resizeHeight = function () {
            nw = wh / r;
            nh = wh;
            nl = ( ww - nw ) / 2;
            nt = ( wh - nh ) / 2;
            return [nh, nw, nl, nt];
        };

        var resizenoupscale = function () {
            nw = w;
            nh = h;
            nl = ( ww - nw ) / 2;
            nt = ( wh - nh ) / 2;
            return [nh, nw, nl, nt];
        };

        if (mode === 'fit') {
            if (wr > r) {
                return resizeWidth();
            }
            return resizeHeight();
        }

        if (mode === 'zoom') {
            if (wr > r) {
                return resizeHeight();
            }
            return resizeWidth();
        }

        if (mode === 'fitNoUpscale') {
            if (h > wh || w > ww) {
                return $.new_get_image_container_size(img, container, "fit");
            }

            return resizenoupscale();
        }
    };
    
    $.fn.bwpbNewParallax = function () {
        
        var element, parent, bgpos, sizemode, speed, dpos, elesize, scrollpos, ratio, bgtoppos, scrolldiff;
        
        element = this;
        parent = $(this).parent();
        bgpos = $(this).data('position');
        sizemode = $(this).data('sizemode');
        speed = $(this).data('speed');

        var reset_parallax = function () {
            setTimeout(function () {
                init_position();
                do_parallax();
                show_parallax();
            }, 300);
        };
        
        var init_position = function () {
            var calcpos = function () {
                var minpos = $(parent).position().top - $(window).height();
                var maxpos = $(parent).position().top + $(parent).outerHeight();
                
                return {
                    'min': minpos,
                    'max': maxpos,
                    'diff': (maxpos - minpos),
                    'wh': $(window).height()
                };
            };

            var calcresize = function () {
                $(element).attr('style', '');

                var eleresizer = null;
                var toppos = 0;
                var leftpos = 0;

                if (sizemode === 'nostretch') {

                    eleresizer = {
                        'elewidth': $(element).width(),
                        'eleheight': $(element).height(),
                        'containerwidth': $(parent).outerWidth(),
                        'containerheight': $(parent).outerHeight()
                    };

                } else {

                    var imagesize = $.new_get_image_container_size($(element), $(window), 'zoom');
                    $(element).css({
                        'height': imagesize[0],
                        'width': imagesize[1]
                    });

                    eleresizer = {
                        'eleheight': imagesize[0],
                        'elewidth': imagesize[1],
                        'containerwidth': $(parent).outerWidth(),
                        'containerheight': $(parent).outerHeight()
                    };

                }

                // initial position
                toppos = ( eleresizer.containerheight - eleresizer.eleheight ) / 2;
                if (bgpos === 'center') {
                    leftpos = ( eleresizer.containerwidth - eleresizer.elewidth ) / 2;
                } else if (bgpos === 'left') {
                    leftpos = 0;
                } else if (bgpos === 'right') {
                    leftpos = eleresizer.containerwidth - eleresizer.elewidth;
                }
                
                doTranslate(element, leftpos + "px", toppos + "px");
                eleresizer.leftpos = leftpos;

                return eleresizer;
            };

            dpos = calcpos();
            elesize = calcresize();
        };

        var fixedbackground = function (scrollpos, ratio, scrolldiff) {
            
            bgtoppos = -1 * ( ( elesize.eleheight - ( elesize.eleheight - dpos.wh ) ) - ( speed * ( dpos.wh / dpos.diff ) ) - scrolldiff + ( ratio * speed ) );
            doTranslate(element, elesize.leftpos + "px", Math.floor(bgtoppos) + "px");
            
        };

        var do_parallax = function () {
            if (dpos !== undefined) {
                ratio = null;
                scrollpos = $(window).scrollTop();

                if (scrollpos >= dpos.min && scrollpos <= dpos.max) {
                    scrolldiff = scrollpos - dpos.min;
                    ratio = scrolldiff / dpos.diff;
                    fixedbackground(scrollpos, ratio, scrolldiff);
                }
            }
        };
        
        var show_parallax = function () {
            element.addClass('parallax-ready');
        }
        
        if ( ! bwpb_params.ismobile ) {
            $(this).imagesLoaded(function() { reset_parallax() });
            $(window).bind('resize', reset_parallax);
            $(window).bind('scroll', do_parallax);
        }else{
            show_parallax();
        }
    };
    
    $.fn.bwpbMultiParallax = function () {
        
        var $el = $(this);
        
        var load_parallax = function () {
            $el.parallax({
                calibrateX: false,
                calibrateY: true,
            });
        }
        
        var do_parallax = function () {
            $el.addClass('parallax-ready');
            if ( ! bwpb_params.ismobile ) {
                load_parallax();
            }
        }
        
        do_parallax();
        //$(window).bind('load', do_parallax);
        
    };
    
    $.fn.bwpbBgVideo = function () {
        
        var $el = $(this),
            $holder = $el.closest('.bwpb-video-holder'),
            $video = $('.bwpb-video-bg', this),
            scale = 1280 / 720;
        
        var uvId = 'bwpb-video-wrap-' + Math.floor(Math.random() * ((999999 - 111111)) + 111111);
        $video.attr('id', uvId);
        
        var reset_params = function () {
            
            if( ( $holder.width() / $holder.height() ) >= scale ) {
                $video.css({
                    'width': '100%',
                    'height': 'auto',
                    'top': ( $video.height() - $holder.height() ) * -0.5,
                    'left': 'auto',
                });
                
            }else{
                
                $video.css({
                    'width': 'auto',
                    'height': '100%',
                    'top': 'auto',
                    'left': ( $video.width() - $holder.width() ) * -0.5,
                });
            }
        };
        
        var video = document.getElementById( uvId );
        video.load();
        
        video.addEventListener('loadeddata', function() {
            reset_params();
        }, false);
        
        $(window).on('debouncedresize', function() {
            reset_params();
        });
    }
    
    // handle google map
    $.fn.bwpbMap = function () {
        return $(this).each(function () {
            var $holder = $(this);
            var $element = $holder.find('.bwpb-map-inner');
            var content = $element.find('.contenthidden').html();
            var options = {
                lat: $element.data('lat'),
                lng: $element.data('lng'),
                zoom: $element.data('zoom'),
                ratio: $element.data('ratio'),
                mapAnimation: $element.data('anim'),
                infobox: $element.data('infobox'),
                firstPin: $element.data('first-pin'),
                newCenter: $element.data('new-center'),
                centerLat: $element.data('center-lat'),
                centerLng: $element.data('center-lng')
            };
            
            var mapresize = function () {
                var elewidth = ( ! $element.hasClass('heading-map') ) ? $element.width() : $(window).height();
                $element.hasClass('ls-full') ? $element.height($(window).height() - parseInt($('#container').css('padding-top'))) : $element.height(elewidth * options.ratio);
            };
            
            var autoCenter = function ( map, markers ) {
                var bounds = new google.maps.LatLngBounds();
                $.each(markers, function (index, marker) {
                    bounds.extend(marker.position);
                });
                map.fitBounds(bounds);
            }

            var createmap = function () {

                var eleid = $element.attr('id');
                
                var custom_style_decoded = (typeof google_map_styles !== 'undefined') ? decodeURIComponent(escape(window.atob( google_map_styles ))) : '';
                var custom_style_object = $.parseJSON(custom_style_decoded);
                
                var mapCenter = ( options.newCenter === true && options.centerLat !== '' && options.centerLng !== '' )
                    ? new google.maps.LatLng(parseFloat(options.centerLat), parseFloat(options.centerLng))
                    : new google.maps.LatLng(parseFloat($('li:first', $holder).attr('data-lat')), parseFloat($('li:first', $holder).attr('data-lng')));
                
                var mapOptions = {
                    zoom:               parseInt(options.zoom, 10),
                    center:             mapCenter,
                    mapTypeId:          google.maps.MapTypeId.ROADMAP,
                    styles:             custom_style_object,
                    zoomControl:        true,
                    streetViewControl:  false,
                    scaleControl:       false,
                    panControl:         false,
                    scrollwheel:        false,
                    mapTypeControl:     false,
                };
                
                var map = new google.maps.Map(document.getElementById(eleid), mapOptions);

                var markers = new Array();
                
                var infowindow = new google.maps.InfoWindow({
                    maxWidth: 250
                });
                
                // Add the markers and infowindows to the map
                if($('li', $holder).length > 0) {
                    
                    var $list = $('li', $holder), markers;
                    
                    function addMarker( $pinList, timeout, i ) {
                        window.setTimeout(function() {
                            var infobox;
                            var googleLocation = new google.maps.LatLng( $pinList.attr('data-lat'), $pinList.attr('data-lng') );
                            var marker = new google.maps.Marker({
                                position: googleLocation,
                                map: map,
                                icon: $pinList.attr('data-pin-img'),
                                animation: options.mapAnimation == true ? google.maps.Animation.DROP : false
                            });
                            
                            markers.push( marker );
                            
                            if( $pinList.attr('data-popup') ) {
                                console.log($pinList);
                                var boxText = document.createElement("div");
                                boxText.style.cssText = "color:#fff;postion:relative;";
                                boxText.innerHTML = "<div class='infoBoxText'>" + str_replace('<p></p>', '', $pinList.html()) + "</div>";
                                
                                infobox = new InfoBox({
                                    content: boxText,
                                    disableAutoPan: false,
                                    maxWidth: 150,
                                    pixelOffset: new google.maps.Size(-140, -75),
                                    zIndex: null,
                                    boxStyle: {
                                        background: "#171717",
                                        opacity: 1,
                                        width: "280px",
                                        padding: "20px"
                                    },
                                    closeBoxMargin: "12px 4px 2px 2px",
                                    closeBoxURL: "http://www.google.com/intl/en_us/mapfiles/close.gif",
                                    infoBoxClearance: new google.maps.Size(1,1)
                                });
                                
                                google.maps.event.addListener(marker, 'click', (function(marker, i) {
                                    return function() {
                                        if( options.infobox ) {
                                            infobox.open(map, this);
                                            //map.panTo(googleLocation);
                                        }else{
                                            infowindow.setContent($pinList.html());
                                            infowindow.open(map, marker);
                                        }
                                    }
                                })(marker, i));
                                
                                if( i == 0 && options.firstPin ) {
                                    setTimeout(function() {
                                        infobox.open(map, marker);
                                    }, 600);
                                }
                                
                            }
                        }, timeout);
                    }
                    
                    for ( var i = 0; i < $list.length; i++ ) {
                        
                        addMarker( $list.eq( i ), ( i + 1 ) * ( options.mapAnimation == true ? 200 : 0 ), i );
                        
                    }
                    
                    // if no center, do center between all pins
                    if( options.newCenter !== true && $('li', $holder).length > 1 ) {
                        
                        autoCenter( map, markers );
                    }
                }

            };

            $(window).bind('resize', mapresize);
            mapresize();
            $('body').imagesLoaded(function() {
                createmap();
            });
            //google.maps.event.addDomListener(window, 'load', createmap);
            
        });
    };
    
})(jQuery);